def distance(pointA, pointB):
    x = pointA[0] - pointB[0]
    y = pointA[1] - pointB[1]
    z = pointA[2] - pointB[2]
    dist = np.sqrt(x**2 + y**2 + z**2)
    return dist


def gathering():
    global res_dict
    threshold = 6
    alldict = {}
    random.seed()
    handful = random.sample(list(res_dict2), 21)
    handful.insert(0, 313)
    handful.append(376)
    for i in handful:
        templist = []
        for j in handful:
            if i == j:
                continue
            if distance(res_dict[i], res_dict[j]) < threshold:
                templist.append(j)
        alldict[i] = templist
    return handful, alldict

